import { StyleSheet } from 'react-native';

export default StyleSheet.create({
    container: {
        height: '100vh',
        width: '350px',
        display: 'flex',
        alignItems: 'center',
        paddingTop: '20px',
        borderColor: 'black',
        borderWidth: '1px',
    },
    menuIconContainer: {
        marginTop: '25px',
        borderColor: 'black',
        borderWidth: '1px',
    },
    menuContentContainer: {
        marginTop: '20%',
        width: '100%',
        height: '70%',
        borderColor: 'black',
        borderWidth: '1px',
    },
    menuContentItem: {
        display: 'flex',
        width: '100%',
        height: '100px',
        justifyContent: 'center',
        borderColor: 'black',
        borderWidth: '1px',
    },
    menuContentItemText: {
        
    }
});
